# Novaya, Republic of Bashkortostan

}}
Novaya (; , Yañawıl) is a rural locality (a village) in Arslanovsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The village has 9 streets and, as of 2010, a population of 358.
Geography
Novaya is located 18 km north of Chishmy, the district's administrative seat. Aminevo is the nearest rural locality.
